      SELECT DISTINCT + 15 + - + col1 / + + 36 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NOT - 5 / + ( + CAST ( NULL AS INTEGER ) ) + + col2 IS NOT NULL ) OR NOT - - col0 IN ( + + col2 );
  - name: tab1

outputs:
  - name: q13338.out
    data: |
      14
      15
